import React from 'react';

const Cart = (props) => {
  const cart = props.cart;
  
  return (
    <div>
         <h3 className="text-primary">Order Summary</h3>
            <h5>Items Ordered: {cart.length}</h5>
    </div>
  );
};

export default Cart;
